import { useState } from "react";

// react-router-dom components
import { Link } from "react-router-dom";

// @mui material components
import Card from "@mui/material/Card";
import Switch from "@mui/material/Switch";
import Grid from "@mui/material/Grid";
//import MuiLink from "@mui/material/Link";

// @mui icons
/*import FacebookIcon from "@mui/icons-material/Facebook";
import GitHubIcon from "@mui/icons-material/GitHub";
import GoogleIcon from "@mui/icons-material/Google";
*/
// Material Kit 2 React components
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";
import MKInput from "components/MKInput";
import MKButton from "components/MKButton";

// Material Kit 2 React example components
import DefaultNavbar from "examples/Navbars/DefaultNavbar";
//import SimpleFooter from "examples/Footers/SimpleFooter";

// Material Kit 2 React page layout routes
import routes from "routes";

// Images
import bgImage from "assets/images/bg-sign-in.jpeg";

function RegisterInBasic() {
  
        const [name, setName] = useState("");
        const [year, setYear] = useState("");
        const [email, setEmail] = useState("");
        const [password,setPassword] = useState("");
        

        const onSubmitForm = async e => {
            e.preventDefault();
            
            try {
                const body = {name,year,email,password};
                const response = await fetch("http://localhost:5000/club",
                {
                    method:"POST",
                    headers:{"Content-Type":"application/json"},
                    body:JSON.stringify(body)
    
                });
                window.location = "/"
                
            } catch (err) {
                console.error(err.messaage);
            }
        }

  return (
    <form onSubmit={onSubmitForm}>
      <TextField type="text" label="Club's Name" fullWidth value={name} onChange={(e) => setName(e.target.value)} />
      <TextField type="text" label="year" fullWidth value={year} onChange={(e) => setYear(e.target.value)} />
      <TextField type="text" label="email" fullWidth value={email} onChange={(e) => setEmail(e.target.value)} />
      <TextField type="text" label="password" fullWidth value={password} onChange={(e) => setPassword(e.target.value)} />
      
      <Button type="submit" variant="contained" color="primary">
        Register
      </Button>
    </form>
  );
}
export default RegisterInBasic ;
